ation &lt;/i&gt;\n        &lt;h2&gt; Duration: 91.45 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 4781 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 421.52 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 248.38 s &lt;/li&gt;\n&lt;li&gt; transfer time: 5.29 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.0.160:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 3072 &lt;/li&gt;\n          &lt;li&gt; Memory: 21.59 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"below":[{"id":"1048"}],"center":[{"id":"1051"},{"id":"1055"}],"left":[{"id":"1052"}],"renderers":[{"id":"1070"}],"sizing_mode":"stretch_both","title":{"id":"1417"},"toolbar":{"id":"1061"},"x_range":{"id":"1040"},"x_scale":{"id":"1044"},"y_range":{"id":"1042"},"y_scale":{"id":"1046"}},"id":"1039","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1040","type":"DataRange1d"},{"attributes":{},"id":"1433","type":"AllLabels"},{"attributes":{},"id":"1458","type":"Selection"},{"attributes":{"start":0},"id":"1286","type":"DataRange1d"},{"attributes":{},"id":"1430","type":"AllLabels"},{"attributes":{"coordinates":null,"group":null},"id":"1417","type":"Title"},{"attributes":{"callback":null},"id":"1092","type":"TapTool"},{"attributes":{},"id":"1457","type":"UnionRenderers"},{"attributes":{},"id":"1479","type":"DatetimeTickFormatter"},{"attributes":{"source":{"id":"1213"}},"id":"1398","type":"CDSView"},{"attributes":{},"id":"1480","type":"AllLabels"},{"attributes":{},"id":"1080","type":"LinearScale"},{"attributes":{"coordinates":null,"group":null},"id":"1415","type":"Title"},{"attributes":{"range_padding":0},"id":"1111","type":"DataRange1d"},{"attributes":{},"id":"1076","type":"DataRange1d"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task
